import * as React from 'react';
import Header from 'features/common/components/Header'
import Footer from 'features/common/components/Footer'
import styled from "styled-components";

import 'features/corona/style/ChartLayOutStyle.css'
import { AppBugReports, HeaderChart, MainChart, StackChart } from 'features/corona/index';
import { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { getToday, getWeek } from "../reducer/coronaSlice";

const ChartLayOut = () => {
  const dispatch = useDispatch()
  // const today = useSelector(state => Object.keys(state.corona.todayState).filter(x => x != 'update_at'))
  const today = useSelector(state => state.corona.todayState)
  // Object.keys(today).filter(x => console.log(`today :: ${x}`))
  Object.keys(today).map((x, i) => {
    console.log(i)
    if(x != 'update_at'){
      console.log(`${today[x]}`)
      console.log(`today :: ${x}`)
    }
  })
  
  // const keys = Object.keys(today).filter(x => x != 'update_at')
  
  // console.log(today)
  useEffect(()=>{
      dispatch(getToday())
      dispatch(getWeek())
  },[])
  return (
    <div class = "wrapper">
      <div class="Chartcontainer">
      <span className="header"><Header/></span> 

        <span class ="item6"><HeaderChart/></span>
        {/* {
          Object.keys(today).map(x => {
            if(x != 'update_at'){
              console.log(`${today[x]}`)
              console.log(`today :: ${x}`)
            }
          })
        } */}
        <span class ="item7"><AppBugReports param={{'label':'text', 'value': 10}}/></span>
        <span class ="item8"><AppBugReports/></span>
        <span class ="item9"><AppBugReports/></span>
        <span class ="item10"><AppBugReports/></span>
        <span class ="item11"><StackChart/></span>
        <span class ="item12"><MainChart/></span>
        
      <span class="ChartFooter"><Footer/></span>
      </div>
    </div>
  );
}

export default ChartLayOut;
